<!DOCTYPE html>
<html>
    <head lang="en">
        <meta charset="UTF-8">
        <title>Core Heatmap Example</title>
        <style> /* SSV main panel */
.ssv-panel {
    position: relative;
    margin: 5px;
    overflow: hidden;
}

/* SSV panel children*/
.ssv-panel .ssv-header {
    position: absolute;
    top: 0;
    height: 25px;
    margin: 2px;
    width: 100%;
    font-size: 16px;
    border-bottom: 1px solid black;
}

.ssv-panel .ssv-title {
    position: relative;
    float: left;
    padding: 5px;
}

.ssv-panel .ssv-visual {
    height: 100%;
    width: 100%;
    padding-top: 30px;
    padding-bottom: 30px;
    box-sizing: border-box;
    overflow: hidden;
    display: table;
}

.ssv-panel .svg-container {
    display: table-cell;
    vertical-align: middle;
}

.ssv-panel #ssv-svg {
    max-height: 100%;
    border-left: 1px solid #E0E0E0;
    border-right: 1px solid #E0E0E0;
}

.ssv-panel #ssv-overlay {
    fill: none;
    pointer-events: all;
}

.ssv-panel .ssv-x-series {
    position: relative;
    float: right;
    padding: 5px;
}

/* SSV mode bar components */
.ssv-panel .modebar {
    position: absolute;
    bottom: 0;
    width: 100%;
    z-index: 1001;
    height:25px;
    opacity: 0;
    transition: opacity 0.3s ease 0s;
}

.ssv-panel:hover .modebar {
    opacity: 0.7;
}


.ssv-panel .modebar-group {
    float: left;
    box-sizing: border-box;
    position: relative;
    vertical-align: middle;
    white-space: nowrap;
    height:100%;
}

.ssv-panel .modebar-button, path {
    float: left;
    position: relative;
    font-size: 14px;
    cursor: pointer;
    box-sizing: border-box;
    margin: 2px;
    height: 100%;
    color: #CFD8DC;
    fill: #CFD8DC;
}

.ssv-panel .modebar-button:hover, .modebar-button:hover path {
    fill: #37474F;
    color: #37474F;
    opacity: 1;
}

.ssv-panel #play-icon svg {
    height:100%;
}

.ssv-panel #pause-icon svg {
    height:100%;
}

.ssv-panel #pan-zoom-enabled-icon svg {
    height:100%;
}

.ssv-panel #pan-zoom-disabled-icon svg {
    height:100%;
}

/* SSV mode bar slider components */
.ssv-panel .slider-track {
    width: 100%;
    height: 100%;
    stroke-width: 8px;
    vertical-align: center;
}

.ssv-panel .slider-inset {
    fill: none;
    stroke: #CFD8DC;
    stroke-width: 8px;
    stroke-linecap: round;
    stroke-opacity: 0.4;
}

.ssv-panel .slider-overlay {
    pointer-events: stroke;
    stroke-width: 50px;
    cursor: crosshair;
}

.ssv-panel .slider-handle {
    fill: #CFD8DC;
    stroke: #000;
    opacity: 0.4;
    stroke-width: 1.25px;
    pointer-events: none;
}

.ssv-panel .slider-overlay:hover + .slider-handle {
    fill: #37474F;
    opacity: 1;
}

/* Animation support */
.ssv-panel .bubble-container{
  animation: ssv-bubbles-move-up 1s linear infinite;
}

.ssv-panel .bubble {
  fill: white;
}

@keyframes ssv-bubbles-move-up {
    100% {
        transform: translateY(-100px);
    }
} </style>
